import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import "./css/search.css";
function Search() {
  return (
    <div className="search-container input-group rounded">
      <div className="search-component  d-flex">
        <input
          type="search"
          className="form-control rounded "
          placeholder="Search"
          aria-label="Search"
          aria-describedby="search-addon"
        />
        <span className="input-group-text border-0" id="search-addon">
          <button className="btn btn-dark"><i className="fas fa-search"></i></button>
        </span>
      </div>
      <div className="divider d-flex justify-content-center align-items-center my-4">
          <p className="text-center fw-bold mx-3 mb-0">Or</p>
        </div>
    </div>
  );
}

export default Search;
